$(document).ready(function () {
  var currentUrl = window.location.pathname;
  var getQueryString = function (field, url) {
    var href = url ? url : window.location.href;
    var reg = new RegExp("[?&]" + field + "=([^&#]*)", "i");
    var string = reg.exec(href);
    return string ? string[1] : null;
  };
  var id = getQueryString("id");
  if (id) {
    $.ajax({
      type: "POST",
      url: CUSTOM_AJAX_BASE + "affiliate_tracking.php?id=" + id,
      data: {
        action: "affTracingHandler",
        id: id,
        chan: getQueryString("chan"),
        data1: getQueryString("data1"),
        data2: getQueryString("data2"),
        gclid: getQueryString("gclid"),
        fbclid: getQueryString("fbclid"),
        msclkid: getQueryString("msclkid"),
        tid: getQueryString("tid"),
        pageUrl: currentUrl,
      },
      success: function (response) {
        if (response.status && response.script) {
          var external = document.createElement("script");
          external.type = "text/javascript";
          external.id = response.script.id;
          external.src = response.script.src;
          var inline = document.createElement("script");
          inline.type = "text/javascript";
          inline.innerHTML = response.script.inline;
          document.body.appendChild(external);
          setTimeout(function () {
            document.body.appendChild(inline);
          }, 5000);
        }
      },
    });
  } else {
    $.ajax({
      type: "POST",
      url: CUSTOM_AJAX_BASE + "affiliate_tracking.php",
      data: { action: "affTracingHandler", pageUrl: currentUrl },
      success: function (response) {
        if (response.status && response.script) {
          var external = document.createElement("script");
          external.type = "text/javascript";
          external.id = response.script.id;
          external.src = response.script.src;
          var inline = document.createElement("script");
          inline.type = "text/javascript";
          inline.innerHTML = response.script.inline;
          document.body.appendChild(external);
          setTimeout(function () {
            document.body.appendChild(inline);
          }, 5000);
        }
      },
    });
  }
});
$(document).ready(function () {
  var currentUrl = window.location.origin + window.location.pathname;
  var replace = "/en|es/";
  var rgx = new RegExp(replace);
  function languageCookieCreate() {
    var langName = window.location.pathname.split("/");
    var date = new Date();
    var expireDate = date.setDate(date.getDate() + 1);
    expireDate += date.toGMTString();
    var domainName = "cloudways.com";
    var cookie =
      langName[1] +
      ";expires=" +
      expireDate +
      ";path=/;domain=" +
      domainName +
      ";secure";
    document.cookie = "cwLang=" + cookie;
  }
  languageCookieCreate();
  if (rgx.test(currentUrl)) {
    $.ajax({
      type: "POST",
      url: CUSTOM_AJAX_BASE + "page_visit_handler.php",
      data: {
        action: "pageVisitHandler",
        pageUrl: currentUrl,
        pageUri: window.location.href,
        setPostID: getPostID,
      },
    });
  }
});
